import { useState } from "react"
import { AiOutlineEye, AiOutlineEyeInvisible} from "react-icons/ai"
import { Link, useNavigate } from "react-router-dom";
import toast from "react-hot-toast";
function SignupForm({setIsLoggedIn}){
const navigate = useNavigate();
  const [formData,setFormData] = useState({
    firstName:"",
    lastName:"",
    email:"",
    password:"",
    confirmPassword:""
  })
  
  const[showPassword,setShowPassword] = useState(false);
  const[showPasswordconfirm,setShowPasswordconfirm] = useState(false);

  function changeHandler(event){
    setFormData((prevData) =>({
        ...prevData,
        [event.target.name]:event.target.value
    }))
  }

  function submitHandler(event){
    event.preventDefault();
    if(formData.password!=formData.confirmPassword){
        toast.error("password not matched");
        return;
    }
    setIsLoggedIn(true);
     toast.success("Account created successfully")
     navigate("/dashboard");
  }
 return(
    <div>

       <div className="flex">
        <button className="bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]">Student</button>
        <button className="bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]">Instructor</button>
       </div>

       <form onSubmit={submitHandler}>

         <div className="flex gap-4">
         <label className="w-full">
            <p className="text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]">First Name<sup>*</sup></p>
            <input className="bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]" required type="text"  name="firstName" onChange={changeHandler}
             placeholder="Enter First Name"  value={formData.firstName}></input>
          </label>

          <label className="w-full">
            <p className="text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]">last Name<sup>*</sup></p>
            <input className="bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]" required type="text"  name="lastName" onChange={changeHandler}
             placeholder="Enter last Name"  value={formData.lastName}></input>
          </label>
         </div>
 
         <label className="w-full">
            <p className="text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]">Email Address<sup>*</sup></p>
            <input className="bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]" required type="email"  name="email" onChange={changeHandler}
             placeholder="Enter email"  value={formData.email}></input>
          </label>

          <div className="flex gap-4">
         <label className="w-full relative">
            <p className="text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]">password<sup>*</sup></p>
            <input className="bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]" required type={showPassword?("text"):("password")}  name="password" onChange={changeHandler}
             placeholder="Enter password"  value={formData.password}></input>

             <span className="absolute right-3 top-9" onClick={()=>setShowPassword((prev)=>!prev)}>
             {!showPassword ? (<AiOutlineEye fontSize={24} fill='#AFB2BF'/>):
             (<AiOutlineEyeInvisible fontSize={24} fill='#AFB2BF'/>)}
             </span>
          </label>

          <label className="w-full relative">
            <p className="text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]">Confirm Password<sup>*</sup></p>
            <input className="bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]" required type={showPasswordconfirm?("text"):("password")}  name="confirmPassword" onChange={changeHandler}
             placeholder="Confirm Password"  value={formData.confirmPassword}></input>

             <span className="absolute right-3 top-9" onClick={()=>setShowPasswordconfirm((prev)=>!prev)}>
             {!showPasswordconfirm ? (<AiOutlineEye fontSize={24} fill='#AFB2BF'/>):
             (<AiOutlineEyeInvisible fontSize={24} fill='#AFB2BF'/>)}
             </span>
          </label>
         </div>
        <button className="mt-4 bg-yellow-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]">Create Account</button>
       </form>
    </div>
 )
}

export default SignupForm
